Kortney Kane is fuming because Rocco the maintenance man is taking for-EVER to fix her stove. She tells him to have it fixed by the time she gets home from work, or else. Rocco knows it's an easy fix, but he's so hot for Kortney that he's purposely milking the job so he can see more of her. Matter of fact, he likes her so much that while napping he dreams that he fucks the shit out of her on the couch and cums all over her chin! Too bad the blue-eyed babe wakes him up and boots him from the job!
